import React from "react";
import ModalFormSignupError from "./ModalFormSignupError";
import ModalFormLoginError from "./ModalFormLoginError";
import ServerError from "./ServerError";
import { useSpring, animated } from "react-spring";
import { Scrollbars } from "react-custom-scrollbars";
import VisibilityOffIcon from "@material-ui/icons/VisibilityOff";
import VisibilityIcon from "@material-ui/icons/Visibility";
import {
  IconButton,
  InputAdornment,
  Grid,
  DialogContent,
  Paper,
  makeStyles,
  TextField,
  Button,
} from "@material-ui/core";
import { IDialogeDataPc, IGrid } from "./appFolder-Interfaces";

function PcModalLogx(DialogeData: IDialogeDataPc) {
  ///
  ///
  ///
  /// DYNAMIC MODAL LAYOUT VARIABLES
  const wideImageControlTrue: string = "75vw";
  const wideImageControlfalse: string = "70vw";
  const zoomImageControl: string = "100vw";
  const GridMiniAwide: IGrid = 8;
  const GridMiniBwide: IGrid = 4;
  const GridMiniAlong: IGrid = 7;
  const GridMiniBlong: IGrid = 5;
  const GridZoomAwide: IGrid = 8;
  const GridZoomBwide: IGrid = 4;
  const GridZoomAlong: IGrid = 6;
  const GridZoomBlong: IGrid = 6;

  let GridHolderA: IGrid = 7;
  let GridHolderB: IGrid = 5;

  let GridxA: IGrid = 7;
  let GridxB: IGrid = 5;

  let GridyA: IGrid = 7;
  let GridyB: IGrid = 5;

  let wideImageControl: string = "70vw";
  let imageReal: string = "75vw";

  let borderGrid: string = "11px";
  var WidthHolder = "82%";

  var opacitySlidingModalImage = "0";
  var zIndexModalImageSmall = 10;
  var zIndexModalImageZoom = 0;
  var opacityFixedModalImage = "1";
  var slidingModalImageBack = "none";
  var slidingImageWidth = "50%";
  var mobilemodalrad = "8px";

  mobileZoom ? (mobilemodalrad = "0px") : (mobilemodalrad = "8px");

  if (zoomedModal) {
    if (imageHeightoverflow) {
      opacitySlidingModalImage = "1";
      zIndexModalImageSmall = 0;
      zIndexModalImageZoom = 10;
      opacityFixedModalImage = "0";
      slidingModalImageBack = "block";
    }

    borderGrid = "0px";

    if (wideImage) {
      slidingImageWidth = "66%";
      WidthHolder = "76%";
      wideImageControl = wideImageControlTrue;
      GridxA = GridZoomAwide;
      GridxB = GridZoomBwide;
    } else {
      slidingImageWidth = "50%";
      WidthHolder = "88%";
      wideImageControl = wideImageControlfalse;
      GridxA = GridZoomAlong;
      GridxB = GridZoomBlong;
    }
    imageReal = zoomImageControl;
    GridHolderA = GridxA;
    GridHolderB = GridxB;
  } else {
    WidthHolder = "82%";
    borderGrid = "11px";

    if (wideImage) {
      wideImageControl = wideImageControlTrue;
      GridyA = GridMiniAwide;
      GridyB = GridMiniBwide;
    } else {
      wideImageControl = wideImageControlfalse;
      GridyA = GridMiniAlong;
      GridyB = GridMiniBlong;
    }
    imageReal = wideImageControl;
    GridHolderA = GridyA;
    GridHolderB = GridyB;
  }
  ///
  ///
  ///
  /// DYNAMIC MODAL LAYOUT VARIABLES

  ///
  ///
  ///
  var fadeSlidingimage = "fadermodal-imageslider";
  if (DialogeData.opacitySlidingModalImage === "0") {
    fadeSlidingimage = "";
  } else {
    fadeSlidingimage = "fadermodal-imageslider-zoomload";
    setTimeout(function () {
      fadeSlidingimage = "fadermodal-imageslider";
    }, 1600);
  }
  return (
    <DialogContent
      style={{
        paddingLeft: "0px",
        height: "100%",
        zIndex: 100,
      }}
    >
      <DialogContent
        className={`${fadeSlidingimage} modalImageCustomSlider FormDialog-containerx dontallowhighlighting`}
        onClick={DialogeData.onBackgroundFocus}
        style={{
          overflow: "auto",
          cursor: "pointer",
          height: "101%",
          padding: "0px",
          width: DialogeData.slidingImageWidth,
          opacity: DialogeData.opacitySlidingModalImage,
          zIndex: DialogeData.zIndexModalImageZoom,
        }}
        ref={DialogeData.ModalBackgroundRef}
      >
        {" "}
        <Scrollbars
          style={{
            width: "100%",
            height: "100%",
          }}
        >
          <animated.div style={DialogeData.modalanimationTwo}>
            <img
              ref={DialogeData.ModalSlidingImageRef}
              onClick={DialogeData.zoomlogmodal}
              onLoad={DialogeData.onimageload}
              src={DialogeData.showimage}
              className="modalImageStylex"
              style={{
                opacity: DialogeData.opacitySlidingModalImage,
              }}
              alt="Logzoom"
            />
          </animated.div>
        </Scrollbars>
      </DialogContent>

      <DialogContent
        className="fadermodal FormDialog-container dontallowhighlighting"
        onClick={DialogeData.onBackgroundFocus}
        style={{ overflow: "hidden", cursor: "pointer" }}
        ref={DialogeData.ModalBackgroundRef}
      >
        <ServerError
          device="pc"
          serverEmojiplain={DialogeData.serverEmojiplain}
          setServerErrorData={DialogeData.setServerErrorData}
          serverErrorDisplay={DialogeData.serverErrorDisplay}
          serverErrorData={DialogeData.serverErrorData}
          darkmode={DialogeData.darkmode}
        />
        <animated.div style={DialogeData.modalanimation}>
          <Paper
            style={{
              backgroundImage: DialogeData.PaperStyle,
              borderRadius: DialogeData.borderGrid,
              cursor: "default",
            }}
          >
            <Grid
              container
              className="containerStyle"
              style={{
                width: DialogeData.imageReal,
                borderRadius: DialogeData.borderGrid,
              }}
            >
              <Grid
                item
                xs={DialogeData.GridHolderA}
                style={{ zIndex: DialogeData.zIndexModalImageSmall }}
              >
                <img
                  onClick={DialogeData.iconclicked}
                  className={
                    DialogeData.zoomedModal
                      ? "hide-logo"
                      : "log-logo  make-small-icons-clickable-neutralB"
                  }
                  src={DialogeData.SuperIcon}
                  alt="SuperstarZ logosmallmode"
                />

                <img
                  onClick={DialogeData.zoomlogmodal}
                  src={DialogeData.showimage}
                  className="modalImageStyle"
                  style={{
                    opacity: DialogeData.opacityFixedModalImage,
                    borderTopLeftRadius: DialogeData.borderGrid,
                    borderBottomLeftRadius: DialogeData.borderGrid,
                  }}
                  alt="Logsmall"
                />
              </Grid>

              {DialogeData.formtype ? (
                <Grid item xs={DialogeData.GridHolderB}>
                  <Grid xs={12} item className="formholder">
                    <Grid
                      item
                      xs={12}
                      className="center-content-vertically"
                      style={{ marginTop: "-5px" }}
                    >
                      <img
                        onClick={DialogeData.iconclicked}
                        className={
                          DialogeData.zoomedModal
                            ? "zoom-login-logo  make-small-icons-clickable-neutral"
                            : "hide-logo "
                        }
                        src={DialogeData.SuperIcon}
                        alt="SuperstarZ logo"
                      />

                      <button
                        onClick={DialogeData.logout}
                        style={{
                          cursor: "pointer",
                          opacity: 0.1,
                          position: "fixed",
                          top: "0.5em",
                          borderRadius: "50%",
                        }}
                      >
                        {" "}
                        ....
                      </button>
                      <ModalFormLoginError
                        device="pc"
                        type={true}
                        ErrorDisplay={DialogeData.errorsLoginInputedUsername}
                        darkmode={DialogeData.darkmode}
                        WidthHolder={DialogeData.WidthHolder}
                      />

                      <TextField
                        style={{
                          width: DialogeData.WidthHolder,
                          paddingBottom: "60px",
                        }}
                        inputProps={{ style: { fontSize: "2.5vh" } }}
                        InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                        label="Username"
                        margin="normal"
                        type="text"
                        onChange={DialogeData.updateLoginvalues}
                        name="inputedUsername"
                        value={DialogeData.rawLogininputedUsername}
                        variant="standard"
                      />
                      <TextField
                        style={{
                          width: DialogeData.WidthHolder,
                          paddingBottom: "40px",
                          zIndex: 1,
                        }}
                        inputProps={{ style: { fontSize: "2.5vh" } }}
                        InputLabelProps={{
                          style: { fontSize: "1.8vh" },
                        }}
                        label="Password"
                        onChange={DialogeData.updateLoginvalues}
                        type={
                          DialogeData.loginShowPassword ? "text" : "password"
                        }
                        name="inputedPassword"
                        value={DialogeData.rawLogininputedPassword}
                        variant="standard"
                        InputProps={{
                          endAdornment: (
                            <InputAdornment position="end">
                              <IconButton
                                onClick={DialogeData.ShowLoginPasswordForaWhile}
                                onMouseDown={
                                  DialogeData.ShowLoginPasswordForaWhile
                                }
                                aria-label="toggle password visibility"
                              >
                                {DialogeData.loginShowPassword ? (
                                  <VisibilityIcon />
                                ) : (
                                  <VisibilityOffIcon />
                                )}
                              </IconButton>
                            </InputAdornment>
                          ),
                        }}
                      />
                      <ModalFormLoginError
                        device="pc"
                        type={false}
                        ErrorDisplay={DialogeData.errorsLoginInputedPassword}
                        darkmode={DialogeData.darkmode}
                        WidthHolder={DialogeData.WidthHolder}
                      />

                      <Grid
                        container
                        style={{ marginTop: "70px", zIndex: 300 }}
                      >
                        <Grid item xs={4}></Grid>
                        <Grid item className="buttonpad buttonshake" xs={4}>
                          <Button
                            onClick={DialogeData.logmein}
                            style={DialogeData.loginstyle}
                            fullWidth={true}
                            variant="outlined"
                            size="large"
                            color="primary"
                          >
                            Log In
                          </Button>
                        </Grid>{" "}
                      </Grid>
                    </Grid>
                  </Grid>
                </Grid>
              ) : (
                <Grid xs={DialogeData.GridHolderB} item className="formholder">
                  <Grid
                    item
                    xs={12}
                    className="center-content-vertically"
                    style={{ padding: "0px" }}
                  >
                    <img
                      onClick={DialogeData.iconclicked}
                      className={
                        DialogeData.zoomedModal
                          ? "zoom-signup-logo make-small-icons-clickable-neutral"
                          : "hide-logo make-small-icons-clickable-neutral "
                      }
                      src={DialogeData.SuperIcon}
                      alt="SuperstarZ logo"
                    />
                    <ModalFormSignupError
                      device="pc"
                      ErrorType={0}
                      textField="email"
                      errorFormChecking={
                        DialogeData.errorFormCheckinginputedEmail
                      }
                      WidthHolder={DialogeData.WidthHolder}
                      darkmode={DialogeData.darkmode}
                      type={true}
                      cantPassBadEmail={DialogeData.cantPassBadEmail}
                      ErrorDisplay={DialogeData.emailErrorDisplay}
                      ErrorData={DialogeData.emailErrorData}
                    />
                    <TextField
                      style={{
                        width: DialogeData.WidthHolder,
                        paddingBottom: "34px",
                      }}
                      inputProps={{ style: { fontSize: "2.5vh" } }}
                      InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                      label="Email"
                      type="email"
                      onChange={DialogeData.updateSignvalues}
                      name="inputedEmail"
                      value={DialogeData.rawSignupValuesinputedEmail}
                      variant="standard"
                    />
                    <ModalFormSignupError
                      device="pc"
                      ErrorType={DialogeData.errorsSignupValuesinputedUsername}
                      textField="username"
                      errorFormChecking={
                        DialogeData.errorFormCheckinginputedUsername
                      }
                      WidthHolder={DialogeData.WidthHolder}
                      darkmode={DialogeData.darkmode}
                      type={true}
                      cantPassBadEmail={DialogeData.cantPassBadEmail}
                      ErrorDisplay={DialogeData.usernameErrorDisplay}
                      ErrorData={DialogeData.usernameErrorData}
                    />
                    <TextField
                      style={{
                        width: DialogeData.WidthHolder,
                        paddingBottom: "50px",
                      }}
                      inputProps={{ style: { fontSize: "2.5vh" } }}
                      InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                      label="Username"
                      type="text"
                      onChange={DialogeData.updateSignvalues}
                      name="inputedUsername"
                      value={DialogeData.rawSignupValuesinputedUsername}
                      variant="standard"
                    />

                    <TextField
                      style={{
                        width: DialogeData.WidthHolder,
                        paddingBottom: "30px",
                        zIndex: 1,
                      }}
                      inputProps={{ style: { fontSize: "2.5vh" } }}
                      InputLabelProps={{ style: { fontSize: "1.8vh" } }}
                      label="Password"
                      type={
                        DialogeData.signupShowPassword ? "text" : "password"
                      }
                      onChange={DialogeData.updateSignvalues}
                      name="inputedPassword"
                      value={DialogeData.rawSignupValuesinputedPassword}
                      variant="standard"
                      InputProps={{
                        endAdornment: (
                          <InputAdornment position="end">
                            <IconButton
                              onClick={DialogeData.ShowSignupPasswordForaWhile}
                              onMouseDown={
                                DialogeData.ShowSignupPasswordForaWhile
                              }
                              aria-label="toggle password visibility"
                            >
                              {DialogeData.signupShowPassword ? (
                                <VisibilityIcon />
                              ) : (
                                <VisibilityOffIcon />
                              )}
                            </IconButton>
                          </InputAdornment>
                        ),
                      }}
                    />
                    <ModalFormSignupError
                      device="pc"
                      ErrorType={0}
                      textField="password"
                      errorFormChecking={
                        DialogeData.errorFormCheckinginputedPassword
                      }
                      darkmode={DialogeData.darkmode}
                      WidthHolder={DialogeData.WidthHolder}
                      type={false}
                      cantPassBadEmail={DialogeData.cantPassBadEmail}
                      ErrorDisplay={DialogeData.passwordErrorDisplay}
                      ErrorData={DialogeData.passwordErrorData}
                    />

                    <Grid container className="modal-hold-signup">
                      <Grid item xs={4}></Grid>
                      <Grid item className="buttonpad buttonshake" xs={4}>
                        <Button
                          style={DialogeData.signupstyle}
                          onClick={DialogeData.signmeup}
                          fullWidth={true}
                          variant="contained"
                          size="large"
                          color="secondary"
                        >
                          Sign Up
                        </Button>
                      </Grid>{" "}
                    </Grid>
                  </Grid>
                </Grid>
              )}
            </Grid>
          </Paper>
        </animated.div>
      </DialogContent>
    </DialogContent>
  );
}

export const PcModalLog = React.memo(PcModalLogx);
